defs.script:
 function toogleLayer(layerName) {
   var layer = document.getElementById(layerName);
   if(layer.style.display == 'none') {
     layer.style.display = 'inline';
   } else {
     layer.style.display = 'none';
   }
 }
function toogleCoast() {
  var coast = document.getElementById('coast');
  if(coast.style.display == 'none') {
    coast.style.display = 'inline';
  } else {
    coast.style.display = 'none';
  }
}
function toogleCountryColorBand() {
  var coast = document.getElementById('country-color-band');
  if(coast.style.display == 'none') {
    coast.style.display = 'inline';
  } else {
    coast.style.display = 'none';
  }
}
function hilightLand(elem, over) {
  if(over) {
    elem.className.baseVal = 'invisible hover';
  } else {
    elem.className.baseVal = 'invisible';
  }
  console.log(elem.className, over, elem.className.baseVal, "" + elem.className + "");
}
